import React from 'react';
import './App.css';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import WelcomePage from './components/WelcomePage';
import InstructionsPage from './components/InstructionsPage';
import ImageProcessingPage from './components/ImageProcessingPage';

function App() {
  return (
    <Router>
      <div className='background'>
        <nav className='container'>
          <div className='content' >
            <Link to="/" className='button'>Trang chủ</Link>
            <Link to="/instructions" className='button'>Hướng dẫn sử dụng</Link>
            <Link to="/image-processing" className='content'>Bắt đầu</Link>
          </div>
        </nav>
        <h1>Chào mừng đến với ứng dụng giảm nhiễu ảnh</h1>
        <Routes>
          <Route path="/" element={<WelcomePage />} />
          <Route path="/instructions" element={<InstructionsPage />} />
          <Route path="/image-processing" element={<ImageProcessingPage />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
